export const modelPortfolio = {
  modelPortfolio: [
    {
      Name: "60 40",
      Position: [
        { Ticker: "SPY", Percentage: 0.6, Asset: "Equity" },
        { Ticker: "BND", Percentage: 0.4, Asset: "Fixed Income" },
      ],
    },
    {
      Name: "Pure Gold",
      Position: [{ Ticker: "GLD", Percentage: 1, Asset: "Gold" }],
    },
  ],
};
